INSERT INTO `contents` (`id`, `name`, `slug`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1,	'About Us',	'about-us',	'<p>Welcome To&nbsp;Tahadiyaat<br />\r\nTahadiyaat&nbsp;is a Professional Sports Booking&nbsp;Platform. Here we provide you with an interesting content, which you will certainly connect with. We&#39;re dedicated to provide&nbsp;you the best of&nbsp;sports venues, with a focus on convience and seemless user experience.&nbsp;We&#39;re working to turn our passion for&nbsp;sports into a booming&nbsp;<a href=\"http://www.tahadiyaat.com/\" target=\"_blank\">online website</a>. We hope you enjoy our&nbsp;sports booking system as much as we enjoy offer it to you.<br />\r\nWe will keep posting more important posts on our&nbsp;website for all of you. Please give your support and love.<br />\r\n<strong>Thanks For Visiting Our Site</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Have a nice day !</strong></p>',	1,	'2020-07-20 19:57:20',	'2023-05-25 04:08:53'),
(7,	'Privacy Policy',	'private-policy',	'<p>&bull; All credit/debit cards&rsquo; details and personally identifiable information<br />\r\nwill NOT be stored, sold, shared, rented or leased to any <strong>third<br />\r\nparties</strong><br />\r\n&bull; <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> will not pass any debit/credit card details to third<br />\r\nparties<br />\r\n&bull; <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> takes appropriate steps to ensure data privacy<br />\r\nand security including through various hardware and software<br />\r\nmethodologies. However <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> (website) cannot<br />\r\nguarantee the security of any information that is disclosed online<br />\r\n&bull; <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> is not responsible for the privacy policies of<br />\r\nwebsites to which it links. If you provide any information to such<br />\r\nthird parties different rules regarding the collection and use of your<br />\r\npersonal information may apply. You should contact these entities<br />\r\ndirectly if you have any questions about their use of the information<br />\r\nthat they collect.<br />\r\n&bull;The Website Policies and Terms &amp; Conditions may be changed or<br />\r\nupdated occasionally to meet the requirements and standards.<br />\r\nTherefore, the Customers&rsquo; are encouraged to frequently visit these<br />\r\nsections to be updated about the changes on the website.<br />\r\nModifications will be effective on the day they are posted.</p>',	1,	'2020-07-20 23:25:05',	'2022-07-25 08:59:16'),
(8,	'Terms of use',	'terms-of-use',	'<p>&bull; <strong>Tahadiyaat sport faciliities managment sole proprietorship L.L.C. </strong>maintains the <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> Website (Site).</p>\r\n\r\n<p>&bull; United Arab of Emirates is our country of domicile and stipulate that the <strong>governing law</strong> is the local law.</p>\r\n\r\n<p>&bull; Any purchase, dispute or claim arising out of or in connection with this website shall be governed and construed in accordance with the laws of UAE</p>\r\n\r\n<p>&bull; Visa or MasterCard debit and credit cards in <strong>AED</strong> will be accepted for payment</p>\r\n\r\n<p>&bull; The displayed price and currency at the checkout page, will be the same price and currency printed on the Transaction Receipt and the amount charged to the card will be shown in your card currency.</p>\r\n\r\n<p>&bull; We will not trade with or provide any services to <strong>OFAC and sanctioned</strong> countries&bull; Customer using the website who are Minor /under the <strong>age of 18</strong> shall not register as a User of the website and shall not transact on or use the website</p>\r\n\r\n<p>&bull; Cardholder must retain a copy of <strong>transaction records</strong> and <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> policies and rules</p>\r\n\r\n<p>&bull; User is responsible for maintaining the <strong>confidentiality</strong> of his account</p>',	1,	'2020-07-20 23:25:05',	'2023-05-25 04:14:25'),
(9,	'How it work',	'how_its_work',	'<p>Out of many players in the sport venue booking market, Tahadiyaat is a big name, and so, it is our inspiration on how a fully-featured and user-friendly court booking app should work?<br />\r\nHere is how the app works:<br />\r\n<strong>User End</strong></p>\r\n\r\n<ul>\r\n	<li>Make a profile for security and customized sport venue search.</li>\r\n	<li>Search for the best ground in the city, they are going to play.</li>\r\n	<li>Compare the ground size and fee</li>\r\n	<li>To save time &amp; effort on web browsers (as best ground are under a single roof).</li>\r\n</ul>\r\n\r\n<p><strong>App End</strong><br />\r\nTo display ground name and photographs, fee and available slots. Available a bulk data of venues of the city.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Why do we use it?</strong><br />\r\nTahadiyaat is a full-fledged ecosystem involving players, ground owners, and booking ventures to act and react on the app. Tahadiyaat is a sport venue booking platform where many sport grounds of football, tennis and cricket are listed. Users can browse a selection of &nbsp;venues and make a booking. To obtain a hassle free booking experience, tahadiyaat is your way to go!</p>',	1,	'2020-07-20 23:25:05',	'2023-05-25 04:09:41'),
(10,	'Payment Confirmation',	'payment_confirmation',	'<p>Once the payment is made, the confirmation notice will be sent to the client via email within 24 hours of receipt</p>',	1,	'2020-07-21 04:55:05',	'2023-05-26 04:26:22'),
(11,	'Refund Policy',	'refund_policy',	'<p><strong>Refunds will be done only through the Original Mode of Payment and&nbsp;will be processed within 10 to 45 days depends on the issuing bank of the credit card.</strong></p>',	1,	'2020-07-21 04:55:05',	'2022-07-25 08:56:15'),
(12,	'Cancellation Policy',	'cancellation_policy',	'<p>Customer can cancel their <strong>requested services</strong> within 24 hours; refunds will be made back to the payment solution used initially by the customer. Please allow for up to 45 days for the refund transfer to be completed.</p>',	1,	'2020-07-21 04:55:05',	'2022-07-25 08:56:48');
INSERT INTO `contents_lang` (`id`, `content_id`, `name`, `description`, `lang`, `created_at`, `updated_at`) VALUES
(1,	1,	'About Us',	'<p>Welcome To&nbsp;Tahadiyaat<br />\r\nTahadiyaat&nbsp;is a Professional Sports Booking&nbsp;Platform. Here we provide you with an interesting content, which you will certainly connect with. We&#39;re dedicated to provide&nbsp;you the best of&nbsp;sports venues, with a focus on convience and seemless user experience.&nbsp;We&#39;re working to turn our passion for&nbsp;sports into a booming&nbsp;<a href=\"http://www.tahadiyaat.com/\" target=\"_blank\">online website</a>. We hope you enjoy our&nbsp;sports booking system as much as we enjoy offer it to you.<br />\r\nWe will keep posting more important posts on our&nbsp;website for all of you. Please give your support and love.<br />\r\n<strong>Thanks For Visiting Our Site</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Have a nice day !</strong></p>',	'en',	'2020-08-21 12:50:31',	'2022-07-25 15:13:14'),
(2,	1,	'About Us',	'<p>مرحبا بكم في تحديات<br />\r\nتحديات هي منصة حجز ملاعب&nbsp;احترافية. سنقدم لك هنا محتوى مثيرًا للاهتمام &nbsp;، والذي سوف يعجبك كثيرًا. نحن ملتزمون بتزويدك بأفضل المنشآت الرياضية لممارسة رياضاتكم المفضلة&nbsp;، مع التركيز على الموثوقية ، الخدمة السهلة و&nbsp;الملائمة لطلبات جميع الرياضيين. نحن نعمل على تحويل شغفنا بالرياضة إلى موقع إلكتروني مزدهر. نأمل أن تستمتع برياضاتنا&nbsp;بقدر ما نتمتع بتقديمها لك.<br />\r\nسأستمر في نشر المزيد من المشاركات المهمة على موقع الويب الخاص بنا&nbsp;لكم جميعًا. من فضلك أعط دعمك وحبك.<br />\r\nشكرا لزيارة موقعنا</p>\r\n\r\n<p>طاب يومك !</p>',	'ar',	'2020-08-21 12:50:31',	'2022-07-25 15:13:14'),
(3,	7,	'Privacy Policy',	'<p>&bull; All credit/debit cards&rsquo; details and personally identifiable information<br />\r\nwill NOT be stored, sold, shared, rented or leased to any <strong>third<br />\r\nparties</strong><br />\r\n&bull; <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> will not pass any debit/credit card details to third<br />\r\nparties<br />\r\n&bull; <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> takes appropriate steps to ensure data privacy<br />\r\nand security including through various hardware and software<br />\r\nmethodologies. However <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> (website) cannot<br />\r\nguarantee the security of any information that is disclosed online<br />\r\n&bull; <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> is not responsible for the privacy policies of<br />\r\nwebsites to which it links. If you provide any information to such<br />\r\nthird parties different rules regarding the collection and use of your<br />\r\npersonal information may apply. You should contact these entities<br />\r\ndirectly if you have any questions about their use of the information<br />\r\nthat they collect.<br />\r\n&bull;The Website Policies and Terms &amp; Conditions may be changed or<br />\r\nupdated occasionally to meet the requirements and standards.<br />\r\nTherefore, the Customers&rsquo; are encouraged to frequently visit these<br />\r\nsections to be updated about the changes on the website.<br />\r\nModifications will be effective on the day they are posted.</p>',	'en',	'2020-08-21 12:51:36',	'2022-07-25 14:29:16'),
(4,	7,	'Privacy Policy',	'<p>&bull; جميع تفاصيل بطاقات الائتمان / الخصم&quot; ومعلومات التعريف الشخصية<br />\r\nلن يتم تخزينها أو بيعها أو مشاركتها أو تأجيرها أو تأجيرها لأي شخص ثالث<br />\r\nحفلات<br />\r\n&bull; لن يقوم موقع www.tahadiyaat.com بتمرير أي تفاصيل لبطاقة الخصم / الائتمان إلى الغير<br />\r\nحفلات<br />\r\n&bull; www.tahadiyaat.com يتخذ الخطوات المناسبة لضمان خصوصية البيانات<br />\r\nوالأمن بما في ذلك من خلال الأجهزة والبرامج المختلفة<br />\r\nالمنهجيات. لكن www.tahadiyaat.com (الموقع) لا يمكنه ذلك<br />\r\nضمان أمن أي معلومات يتم الكشف عنها عبر الإنترنت&nbsp;<br />\r\n&bull; موقع www.tahadiyaat.com غير مسئول عن سياسات الخصوصية الخاصة بموقع<br />\r\nالمواقع التي يرتبط بها. إذا قدمت أي معلومات لمثل هذا<br />\r\nقواعد مختلفة للجهات الخارجية فيما يتعلق بجمع واستخدام ملفات<br />\r\nقد تنطبق المعلومات الشخصية. يجب عليك الاتصال بهذه الكيانات<br />\r\nمباشرة إذا كان لديك أي أسئلة حول استخدامهم للمعلومات<br />\r\nالتي يجمعونها .<br />\r\n&bull; قد يتم تغيير سياسات الموقع الإلكتروني والشروط والأحكام أو<br />\r\nتحديثها من حين لآخر لتلبية المتطلبات والمعايير.<br />\r\nلذلك ، يتم تشجيع العملاء على زيارة هذه المواقع بشكل متكرر<br />\r\nأقسام ليتم تحديثها حول التغييرات على الموقع.<br />\r\nستكون التعديلات سارية المفعول في يوم نشرها .</p>\r\n\r\n<p>&nbsp;</p>',	'ar',	'2020-08-21 12:51:36',	'2022-07-25 14:29:16'),
(5,	8,	'Terms of use',	'<p>&bull; <strong>Tahadiyaat sport faciliities managment sole proprietorship L.L.C. </strong>maintains the <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> Website (Site).</p>\r\n\r\n<p>&bull; United Arab of Emirates is our country of domicile and stipulate that the <strong>governing law</strong> is the local law.</p>\r\n\r\n<p>&bull; Any purchase, dispute or claim arising out of or in connection with this website shall be governed and construed in accordance with the laws of UAE</p>\r\n\r\n<p>&bull; Visa or MasterCard debit and credit cards in <strong>AED</strong> will be accepted for payment</p>\r\n\r\n<p>&bull; The displayed price and currency at the checkout page, will be the same price and currency printed on the Transaction Receipt and the amount charged to the card will be shown in your card currency.</p>\r\n\r\n<p>&bull; We will not trade with or provide any services to <strong>OFAC and sanctioned</strong> countries&bull; Customer using the website who are Minor /under the <strong>age of 18</strong> shall not register as a User of the website and shall not transact on or use the website</p>\r\n\r\n<p>&bull; Cardholder must retain a copy of <strong>transaction records</strong> and <a href=\"http://www.tahadiyaat.com\">www.tahadiyaat.com</a> policies and rules</p>\r\n\r\n<p>&bull; User is responsible for maintaining the <strong>confidentiality</strong> of his account</p>',	'en',	'2020-08-21 12:51:36',	'2022-07-25 14:35:52'),
(6,	8,	'Terms of use',	'<p>مرحبا بكم في تحديات!</p>\r\n\r\n<p>تحدد هذه الشروط والأحكام القواعد واللوائح الخاصة باستخدام موقع تحديات الموجود على www.tahadiyaat.com.</p>\r\n\r\n<p>من خلال الوصول إلى هذا الموقع ، نفترض أنك تقبل هذه الشروط والأحكام. لا تستمر في استخدام تحديات إذا كنت لا توافق على أخذ جميع الشروط والأحكام المذكورة في هذه الصفحة.</p>\r\n\r\n<p>تنطبق المصطلحات التالية على هذه الشروط والأحكام وبيان الخصوصية وإشعار إخلاء المسؤولية وجميع الاتفاقيات: يشير مصطلح &quot;العميل&quot; و &quot;أنت&quot; و &quot;الخاص بك&quot; إليك ، والشخص الذي يقوم بتسجيل الدخول إلى هذا الموقع الإلكتروني ومتوافق مع شروط وأحكام الشركة. تشير &quot;الشركة&quot; و &quot;أنفسنا&quot; و &quot;نحن&quot; و &quot;لنا&quot; و &quot;نحن&quot; إلى شركتنا. يشير &quot;الطرف&quot; أو &quot;الأطراف&quot; أو &quot;نحن&quot; إلى كل من العميل وأنفسنا. تشير جميع الشروط إلى العرض والقبول والنظر في الدفع اللازم للاضطلاع بعملية مساعدتنا للعميل بالطريقة الأنسب للغرض الصريح المتمثل في تلبية احتياجات العميل فيما يتعلق بتوفير خدمات الشركة المعلنة ، وفقًا لـ وتخضع للقانون السائد في هولندا. أي استخدام للمصطلحات المذكورة أعلاه أو غيرها من الكلمات في صيغة المفرد والجمع و / أو هو / هي أو هم ، يتم اعتباره قابلاً للتبادل وبالتالي يشير إلى نفسه.</p>\r\n\r\n<p>ملفات تعريف الارتباط<br />\r\nنحن نوظف استخدام ملفات تعريف الارتباط. من خلال الوصول إلى تحديات ، فإنك توافق على استخدام ملفات تعريف الارتباط بالاتفاق مع سياسة الخصوصية الخاصة بالتحديات.</p>\r\n\r\n<p>تستخدم معظم مواقع الويب التفاعلية ملفات تعريف الارتباط للسماح لنا باسترداد تفاصيل المستخدم لكل زيارة. يستخدم موقعنا ملفات تعريف الارتباط لتمكين وظائف مناطق معينة لتسهيل زيارة الأشخاص لموقعنا. قد يستخدم بعض الشركاء التابعين / المعلنين أيضًا ملفات تعريف الارتباط.</p>\r\n\r\n<p>رخصة<br />\r\nما لم يُنص على خلاف ذلك ، تمتلك تحديات و / أو المرخصون التابعون لها حقوق الملكية الفكرية لجميع المواد الموجودة على تحديات. جميع حقوق الملكية الفكرية محفوظة. يمكنك الوصول إلى هذا من تحديات لاستخدامك الشخصي مع مراعاة القيود المنصوص عليها في هذه الشروط والأحكام.</p>\r\n\r\n<p>لا يجب عليك:</p>\r\n\r\n<p>إعادة نشر المواد من تحديات<br />\r\nبيع أو تأجير أو ترخيص المواد من تحديات<br />\r\nإعادة إنتاج أو نسخ أو نسخ المواد من تحديات<br />\r\nإعادة توزيع المحتوى من تحديات</p>\r\n\r\n<p>يجب أن تبدأ هذه الاتفاقية في تاريخ هذا. تم إنشاء الشروط والأحكام الخاصة بنا بمساعدة نموذج الشروط والأحكام.</p>\r\n\r\n<p>توفر أجزاء من هذا الموقع فرصة للمستخدمين لنشر وتبادل الآراء والمعلومات في مناطق معينة من الموقع. لا تقوم تحديات بتصفية أو تحرير أو نشر أو مراجعة التعليقات قبل ظهورها على الموقع. لا تعكس التعليقات آراء وآراء تحديات و / أو وكلائها و / أو الشركات التابعة لها. تعكس التعليقات وجهات نظر وآراء الشخص الذي ينشر وجهات نظره وآرائه. إلى الحد الذي تسمح به القوانين المعمول بها ، لن تكون تحديات مسؤولة عن التعليقات أو عن أي مسؤولية أو أضرار أو نفقات ناتجة و / أو تكبدتها نتيجة لأي استخدام و / أو نشر و / أو ظهور التعليقات على هذا. موقع الكتروني.</p>\r\n\r\n<p>تحتفظ تحديات بالحق في مراقبة جميع التعليقات وإزالة أي تعليقات يمكن اعتبارها غير لائقة أو مسيئة أو تسبب انتهاكًا لهذه الشروط والأحكام.</p>\r\n\r\n<p>أنت تضمن وتمثل ما يلي:</p>\r\n\r\n<p>يحق لك نشر التعليقات على موقعنا والحصول على جميع التراخيص والموافقات اللازمة للقيام بذلك ؛<br />\r\nلا تنتهك التعليقات أي حق من حقوق الملكية الفكرية ، بما في ذلك على سبيل المثال لا الحصر حقوق النشر أو براءات الاختراع أو العلامات التجارية لأي طرف ثالث ؛<br />\r\nلا تحتوي التعليقات على أي مواد تشهيرية أو تشهيرية أو مسيئة أو غير لائقة أو غير قانونية بأي شكل مما يعد انتهاكًا للخصوصية<br />\r\nلن يتم استخدام التعليقات لالتماس أو الترويج للأعمال أو الأنشطة التجارية المخصصة أو الحالية أو نشاط غير قانوني.<br />\r\nأنت بموجب هذا تمنح تحديات ترخيصًا غير حصري لاستخدام وإعادة إنتاج وتحرير وتفويض الآخرين لاستخدام وإعادة إنتاج وتحرير أي من تعليقاتك في أي وجميع الأشكال أو الأشكال أو الوسائط.</p>\r\n\r\n<p>الارتباط التشعبي إلى المحتوى الخاص بنا<br />\r\nقد ترتبط المنظمات التالية بموقعنا على الويب دون موافقة كتابية مسبقة:</p>\r\n\r\n<p>وكالات الحكومة؛<br />\r\nمحركات البحث<br />\r\nالمنظمات الإخبارية ؛<br />\r\nيجوز لموزعي الدليل عبر الإنترنت الارتباط بموقعنا الإلكتروني بنفس طريقة الارتباط التشعبي لمواقع الويب الخاصة بشركات أخرى مدرجة ؛ و<br />\r\nالشركات المعتمدة على مستوى النظام باستثناء طلب المنظمات غير الربحية ومراكز التسوق الخيرية ومجموعات جمع التبرعات الخيرية التي قد لا ترتبط ارتباطًا تشعبيًا بموقعنا على الويب.<br />\r\nقد ترتبط هذه المنظمات بصفحتنا الرئيسية أو بالمنشورات أو بمعلومات أخرى على موقع الويب طالما أن الرابط: (أ) ليس مضللاً بأي شكل من الأشكال ؛ (ب) لا يعني ضمنيًا رعاية أو تأييد أو موافقة الطرف المرتبط ومنتجاته و / أو خدماته ؛ و (ج) يناسب سياق موقع الطرف المرتبط.</p>\r\n\r\n<p>يجوز لنا النظر في طلبات الارتباط الأخرى والموافقة عليها من الأنواع التالية من المؤسسات:</p>\r\n\r\n<p>مصادر معلومات المستهلك و / أو الأعمال المعروفة ؛<br />\r\nمواقع مجتمع dot.com ؛<br />\r\nالجمعيات أو المجموعات الأخرى التي تمثل الجمعيات الخيرية ؛<br />\r\nموزعي الدليل عبر الإنترنت ؛<br />\r\nبوابات الإنترنت<br />\r\nشركات المحاسبة والقانون والاستشارات ؛ و<br />\r\nالمؤسسات التعليمية والجمعيات التجارية.<br />\r\nسنوافق على طلبات الارتباط من هذه المنظمات إذا قررنا ما يلي: (أ) لن يجعلنا الرابط ننظر إلى أنفسنا أو إلى أعمالنا المعتمدة ؛ (ب) ليس لدى المنظمة أي سجلات سلبية معنا ؛ (ج) تعوض الاستفادة من رؤية الارتباط التشعبي عدم وجود تحديات ؛ و (د) الارتباط في سياق معلومات الموارد العامة.</p>\r\n\r\n<p>قد ترتبط هذه المنظمات بصفحتنا الرئيسية طالما أن الرابط: (أ) ليس مخادعًا بأي شكل من الأشكال ؛ (ب) لا يعني ضمنيًا رعاية أو تأييد أو موافقة الطرف المرتبط ومنتجاته أو خدماته ؛ و (ج) يناسب سياق موقع الطرف المرتبط.</p>\r\n\r\n<p>إذا كنت من المنظمات المذكورة في الفقرة 2 أعلاه وتهتم بالارتباط بموقعنا ، يجب عليك إبلاغنا عن طريق إرسال بريد إلكتروني إلى تحديات. يرجى تضمين اسمك واسم مؤسستك ومعلومات الاتصال بالإضافة إلى عنوان URL الخاص بموقعك وقائمة بأي عناوين URL تنوي الارتباط بموقعنا على الويب وقائمة عناوين URL الموجودة على موقعنا والتي ترغب في الوصول إليها حلقة الوصل. انتظر 2-3 أسابيع للرد.</p>\r\n\r\n<p>يجوز للمنظمات المعتمدة الارتباط التشعبي لموقعنا على النحو التالي:</p>\r\n\r\n<p>عن طريق استخدام اسم شركتنا ؛ أو<br />\r\nعن طريق استخدام محدد موقع الموارد الموحد الذي يتم ربطه بـ ؛ أو<br />\r\nمن خلال استخدام أي وصف آخر لموقعنا على الويب يتم ربطه بهذا الأمر في سياق وشكل المحتوى على موقع الطرف المرتبط.<br />\r\nلن يُسمح باستخدام شعار تحديات أو أي عمل فني آخر لربط غياب اتفاقية ترخيص العلامة التجارية.</p>\r\n\r\n<p>إطارات iFrames<br />\r\nبدون موافقة مسبقة وإذن كتابي ، لا يجوز لك إنشاء إطارات حول صفحات الويب الخاصة بنا والتي تغير بأي شكل من الأشكال العرض التقديمي المرئي لموقعنا أو مظهره.</p>\r\n\r\n<p>المسؤولية عن المحتوى<br />\r\nلن نتحمل المسؤولية عن أي محتوى يظهر على موقع الويب الخاص بك. أنت توافق على حمايتنا والدفاع عنا ضد جميع المطالبات التي تنشأ على موقع الويب الخاص بك. يجب ألا يظهر أي رابط (روابط) على أي موقع ويب يمكن تفسيره على أنه تشهيري أو فاحش أو إجرامي ، أو ينتهك أو ينتهك أو يدعو إلى التعدي أو الانتهاك الآخر لحقوق أي طرف ثالث.</p>\r\n\r\n<p>خصوصيتك<br />\r\nيرجى قراءة سياسة الخصوصية</p>\r\n\r\n<p>تحفظ الحقوق<br />\r\nنحتفظ بالحق في مطالبتك بإزالة جميع الروابط أو أي رابط معين لموقعنا على الويب. أنت توافق على إزالة جميع الروابط إلى موقعنا على الفور عند الطلب. نحتفظ أيضًا بالحق في تعديل هذه الشروط والأحكام وسياسة الربط الخاصة بها في أي وقت. من خلال الارتباط المستمر بموقعنا ، فإنك توافق على الالتزام بشروط وأحكام الربط هذه واتباعها.</p>\r\n\r\n<p>إزالة الروابط من موقعنا<br />\r\nإذا وجدت أي رابط على موقعنا مسيء لأي سبب من الأسباب ، فأنت حر في الاتصال بنا وإبلاغنا في أي لحظة. سننظر في طلبات إزالة الروابط ولكننا لسنا ملزمين بذلك أو بالرد عليك مباشرة.</p>\r\n\r\n<p>لا نضمن صحة المعلومات الواردة في هذا الموقع ، ولا نضمن اكتمالها أو دقتها ؛ كما أننا لا نعد بضمان بقاء موقع الويب متاحًا أو تحديث المواد الموجودة على الموقع.</p>\r\n\r\n<p>تنصل<br />\r\nإلى أقصى حد يسمح به القانون المعمول به ، نستبعد جميع الإقرارات والضمانات والشروط المتعلقة بموقعنا على الويب واستخدام هذا الموقع. لا شيء في إخلاء المسؤولية هذا:</p>\r\n\r\n<p>تحديد أو استبعاد مسؤوليتنا أو مسؤوليتك عن الوفاة أو الإصابة الشخصية ؛<br />\r\nتحديد أو استبعاد مسؤوليتنا أو مسؤوليتك عن الاحتيال أو التحريف الاحتيالي ؛<br />\r\nتقييد أي من مسؤولياتنا أو التزاماتك بأي طريقة غير مسموح بها بموجب القانون المعمول به ؛ أو<br />\r\nاستبعاد أي من التزاماتنا أو التزاماتك التي قد لا يتم استبعادها بموجب القانون المعمول به.<br />\r\nقيود وحظر المسؤولية المنصوص عليها في هذا القسم وفي أي مكان آخر في إخلاء المسؤولية هذا: (أ) تخضع للفقرة السابقة ؛ و (ب) تحكم جميع الالتزامات الناشئة بموجب إخلاء المسؤولية ، بما في ذلك الالتزامات الناشئة في العقد ، في حالة الضرر وخرق الواجب القانوني.</p>\r\n\r\n<p>طالما يتم توفير موقع الويب والمعلومات والخدمات على الموقع مجانًا ، فلن نكون مسؤولين عن أي خسارة أو ضرر من أي نوع.</p>',	'ar',	'2020-08-21 12:51:36',	'2022-07-25 14:35:52'),
(7,	9,	'How it work',	'<p>Out of many players in the sport venue booking market, Tahadiyaat is a big name, and so, it is our inspiration on how a fully-featured and user-friendly court booking app should work?<br />\r\nHere is how the app works:<br />\r\n<strong>User End</strong></p>\r\n\r\n<ul>\r\n	<li>Make a profile for security and customized sport venue search.</li>\r\n	<li>Search for the best ground in the city, they are going to play.</li>\r\n	<li>Compare the ground size and fee</li>\r\n	<li>To save time &amp; effort on web browsers (as best ground are under a single roof).</li>\r\n</ul>\r\n\r\n<p><strong>App End</strong><br />\r\nTo display ground name and photographs, fee and available slots. Available a bulk data of venues of the city.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Why do we use it?</strong><br />\r\nTahadiyaat is a full-fledged ecosystem involving players, ground owners, and booking ventures to act and react on the app. Tahadiyaat is a sport venue booking platform where many sport grounds of football, tennis and cricket are listed. Users can browse a selection of &nbsp;venues and make a booking. To obtain a hassle free booking experience, tahadiyaat is your way to go!</p>',	'en',	'2020-08-21 12:51:36',	'2022-07-25 15:20:49'),
(8,	9,	'How it work',	'<p>من بين العديد من اللاعبين في سوق&nbsp;حجز الملاعب الرياضية ، تعد تحديات اسمًا كبيرًا ، وبالتالي ، فهي مصدر إلهامنا لكيفية عمل تطبيق حجز الملاعب&nbsp;سهل الاستخدام ومتكامل الميزات؟<br />\r\nإليك كيفية عمل التطبيق:<br />\r\n&nbsp; بصفتك المستخدم</p>\r\n\r\n<p>قم بعمل ملف تعريف للأمن والبحث المخصص عن الأماكن الرياضية.<br />\r\nابحث عن أفضل ملعب في المدينة ، سوف يلعبون فيه.<br />\r\nقارن حجم الملعب والرسوم<br />\r\nلتوفير الوقت والجهد على متصفحات الويب (حيث أن أفضل أرضية موجودة تحت سقف واحد).<br />\r\nألحق<br />\r\nلعرض اسم الأرض والصور الفوتوغرافية والرسوم والحجوزات&nbsp;المتاحة. تتوفر بيانات مجمعة عن أماكن المدينة.</p>\r\n\r\n<p>لماذا نستخدمه؟<br />\r\nتحديات هي نظام بيئي متكامل يضم لاعبين و&nbsp; مالكي منشآت رياضية &nbsp;للعمل معا والتفاعل على التطبيق. تعد تحديات منصة حجز ملاعب رياضية حيث يتم إدراج العديد من الملاعب الرياضية لكرة القدم و&nbsp;للتنس والكريكيت . يمكن للمستخدمين تصفح مجموعة مختارة من أكثر من &nbsp;مكان وإجراء الحجز. للحجز الخالي من المتاعب ، يمكنك الان استخدام تحديات.</p>',	'ar',	'2020-08-21 12:51:36',	'2022-07-25 15:20:49'),
(9,	10,	'Payment Confirmation',	'<p>Once the payment is made, the confirmation notice will be sent to the client via email within 24 hours of receipt</p>',	'en',	'2020-08-21 12:51:36',	'2023-05-26 09:56:22'),
(10,	10,	'Payment Confirmation',	'<p>بمجرد إجراء الدفع ، سيتم إرسال إشعار التأكيد إلى العميل عبر البريد الإلكتروني في غضون 24 ساعة من الاستلام</p>',	'ar',	'2020-08-21 12:51:36',	'2023-05-26 09:56:22'),
(11,	11,	'Refund Policy',	'<p><strong>Refunds will be done only through the Original Mode of Payment and&nbsp;will be processed within 10 to 45 days depends on the issuing bank of the credit card.</strong></p>',	'en',	'2020-08-21 12:51:36',	'2022-07-25 14:26:15'),
(12,	11,	'Refund Policy',	'<p>&nbsp;ستتم عمليات رد الأموال فقط من خلال طريقة الدفع الأصلية وستتم معالجتها في غضون 10 إلى 45 يومًا اعتمادًا على البنك المُصدر لبطاقة الائتمان.</p>',	'ar',	'2020-08-21 12:51:36',	'2022-07-25 14:26:15'),
(13,	12,	'Cancellation Policy',	'<p>Customer can cancel their <strong>requested services</strong> within 24 hours; refunds will be made back to the payment solution used initially by the customer. Please allow for up to 45 days for the refund transfer to be completed.</p>',	'en',	'2020-08-21 12:51:36',	'2022-07-25 14:26:48'),
(14,	12,	'Cancellation Policy',	'<p>يمكن للعميل إلغاء الخدمات المطلوبة في غضون 24 ساعة ؛ ستتم إعادة المبالغ المستردة إلى حل الدفع الذي استخدمه العميل في البداية. يُرجى الانتظار 45 يومًا حتى تكتمل عملية تحويل المبالغ المستردة.</p>',	'ar',	'2020-08-21 12:51:36',	'2022-07-25 14:26:48');
